import React from 'react';
import logo from './logo.svg';
import './App.css';
import Navigation from './components/Navigation/Navigation';
import SignIn from './components/SignIn/SignIn';

function App() {
  return (
    <div className="App">
      <Navigation />
      <SignIn />
    </div>
  );
}

export default App;
